import React from "react";

const Results = (props) => {
  let results = props.shows.map((show, index) => {
    return (
      <div
        className="card border-primary mb-3"
        style={{ width: "18rem" }}
        key={index}
      >
        <img className="card-image" src={show.image} alt={show.name} />
        <div className="card-body">
          <h5 className="card-title">{show.name}</h5>
          <p className="card-text">{show.summary}</p>
        </div>

        <ul class="list-group list-group-flush">
          <div class="card-body">
            <a href="#" className="card-link">
              Link 1
            </a>
            <a href="#" className="card-link">
              Link 2
            </a>
          </div>
        </ul>

        <ul class="list-group list-group-flush">
          <li class="list-group-item">
            <button
              className="btn btn-primary"
              onClick={(e) => {
                e.preventDefault();
                window.open(show.officialSite);
              }}
            >
              Watch here
            </button>
          </li>
        </ul>
      </div>
    );
  });

  return (
    <>
      <div className="backToSearch">
        <button onClick={props.onSearchAgain} className="btn btn-danger">
          Back to Search
        </button>
        <br />
        <br />
      </div>
      <section className="cards">
        <div class="card-deck">{results}</div>
      </section>
    </>
  );
};

export default Results;
